__NUXT_JSONP__("/works/asayakenoato-web2014", (function(a){return {data:[{work:{id:"asayakenoato-web2014",createdAt:a,updatedAt:"2022-01-08T12:50:17.517Z",publishedAt:a,revisedAt:a,title:"asayake no ato \u002F RENEWAL WEB SITE",category:[],release:"2014-09-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fb9bf9c9aba07420088b990bb3f1afa96\u002Fasayake_1-1.jpg",height:670,width:1080},overview:"京都出身4Pロックバンドasayake no atoさんのウェブサイトを制作させていただきました。\n\n「情景・時間・透明感」をテーマに音の情景を切り取ったデザインに仕上がりました。プロフィールページ以外の写真も担当させていただきました。\n\nasayake no atoさんの音から受ける「情景」と「透明感」、ロゴのコピーで使用していた「Are in recollection and the future」から時間をキーワードにPCサイズではトップページで映像が流れる仕組みにしています。\n\nライブ情報の更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"}}],fetch:{},mutations:void 0}}("2022-01-08T12:30:30.713Z")));